import React from 'react';


function Nav(props) {
    const {
        navOptions = [],
        currentOption,
        setCurrentOption 
    } = props;

    return(
        <header>
            <nav>
                <div>This is the nav</div>
                <h2>Justin Hanson</h2>
                <ul>
                    {navOptions.map((navOption) => (
                        <li>
                            <span>
                                {navOption.option}
                            </span>
                        </li>
                    ))}
                </ul>

            </nav>
        </header>
    )
}

export default Nav;
